import animals from "./js/_input";
import { randomNumberWithDecimalInRange, numberToArray } from "./js/utils";

class Animal {
  constructor({ ...args }) {
    const { type, props, treeDepthAmount, parent, childIndex } = args;

    this.type = type;
    this.gender = ["boy", "girl"][
      randomNumberWithDecimalInRange({ min: 0, max: 1 })
    ];
    this.treeDepthAmount = treeDepthAmount;
    this.parent = parent || null;
    this.childIndex = childIndex;
    this.props = props;

    this.deathYear = this.setRandomValue("deathYear");
    this.pregnancyStartsFrom = this.setRandomValue("pregnancyStartsFrom");

    this.pregnancyDuration = props?.pregnancyDuration;
    this.twins = props?.twins;
    this.givingBirth = props?.givingBirth;
  }

  get name() {
    const singularAnimal = this.type.slice(0, -1);
    const postfix = `-${this.childIndex}`;
    const initialName = this.parent?.name ? this.parent.name : singularAnimal;

    return initialName + postfix;
  }

  get generateAge() {
    const isParentAge = this?.parent?.age;
    const min = 0;
    const decimal = 2;
    const max = isParentAge
      ? this.parent.age - this.pregnancyDuration
      : this.deathYear;

    return (this.age = randomNumberWithDecimalInRange({ min, max, decimal }));
  }

  get canGiveBirth() {
    return (
      this.gender === "girl" &&
      this.treeDepthAmount > 0 &&
      this.age > this.setRandomValue("pregnancyDuration")
    );
  }

  get animalInfo() {
    const { givingBirth, age, name } = this;

    return { givingBirth, age, name };
  }

  get children() {
    return this.canGiveBirth
      ? new AnimalChildren({
          parent: this.animalInfo,
          props: this.props,
          type: this.type,
          childIndex: this.childIndex,
          treeDepthAmount: this.treeDepthAmount,
        }).create()
      : false;
  }

  downgradeTree() {
    this.treeDepthAmount -= 1;
  }

  setRandomValue(field, decimal = 2) {
    return this.props[field]
      ? randomNumberWithDecimalInRange({
          min: this.props[field].min,
          max: this.props[field].max,
          decimal,
        })
      : null;
  }

  create(twinsAge) {
    this.downgradeTree();

    const name = this.name;
    const age = (this.age = twinsAge || this.generateAge);
    const gender = this.gender;
    const children = this.children;

    return { name, age, gender, ...(children && { children }) };
  }
}

class AnimalChildren {
  constructor({ ...args }) {
    const { type, props, treeDepthAmount, parent } = args;

    this.type = type;
    this.parent = parent || null;
    this.treeDepthAmount = treeDepthAmount;
    this.props = props;
  }

  get childrenArray() {
    const min = 0;
    const max = this.parent ? this.parent.givingBirth : 18;
    const randomChildrenAmount = randomNumberWithDecimalInRange({ min, max });
    const childrenArray = numberToArray(randomChildrenAmount);
    const isNotFirstGeneration = this.parent;
    const children = !isNotFirstGeneration
      ? this.createTwinsArray(childrenArray)
      : childrenArray;

    console.log("children:", children);

    return children;
  }

  areTwins(birth) {
    return Object.keys(birth).length;
  }

  createRandom(field, decimal = 0) {
    return randomNumberWithDecimalInRange({
      min: this.props[field].min,
      max: this.props[field].max,
      decimal,
    });
  }

  createTwinsArray(arr) {
    console.log("this:", this);
    return arr.map(() => {
      const randomTwinsAmount = this.parent
        ? this.createRandom("twins")
        : null;
      return numberToArray(randomTwinsAmount);
    });
  }

  createChild({ twinsAge, index }) {
    return new Animal({
      parent: this.parent,
      type: this.type,
      treeDepthAmount: this.treeDepthAmount,
      childIndex: index + 1,
      props: this.props,
    }).create(twinsAge);
  }

  createTwinsAge({ prev, index }) {
    return prev.length ? prev[index - 1].age : null;
  }

  createTwins(arr) {
    const children = arr.reduce((prev, _, index) => {
      const twinsAge = this.createTwinsAge({ prev, index });
      const child = this.createChild({ twinsAge, index });

      return [...prev, child];
    }, []);

    return { twins: children };
  }

  create() {
    return this.childrenArray.reduce((prev, curr, index) => {
      const birth = this.areTwins(curr)
        ? this.createTwins(curr)
        : this.createChild({ index });

      return [...prev, birth];
    }, []);
  }
}

class Farm {
  constructor(animals) {
    this.animals = animals;
  }

  generateAnimalTree(type, props) {
    const treeDepthAmount = randomNumberWithDecimalInRange({ min: 2, max: 5 });
    return new AnimalChildren({ type, props, treeDepthAmount }).create();
  }

  create() {
    return Object.entries(this.animals).reduce(
      (obj, [type, props]) => ({
        ...obj,
        [type]: this.generateAnimalTree(type, props),
      }),
      {}
    );
  }
}

const farm1 = new Farm(animals).create();

console.log("---------------");
console.log("farm1:", farm1);
